(function(){
    let ii = setInterval(function(){
        let vv = document.querySelector('div[id*=vodbox]');
        if(vv && vv.classList && !vv.classList.contains('videoFull')){
            vv.classList.add('videoFull')
            vv.style.setProperty('width', window.screen.availWidth + 'px', 'important');
            vv.style.setProperty('height', window.screen.availHeight + 'px', 'important');
            clearInterval(ii)
			//viewTVs()
        }
    }, 1000)
})()

let lastCenterPressTime = 0;
let moveTagert = 'pid'

function doAction(opt){
    if(moveTagert == 'pid' && (opt == 'up' || opt == 'down')){
        let nodes = [...document.querySelector('div.tv-main-con-r-list-left').childNodes];
        let cid = nodes.findIndex(e => e.classList.contains('tvFocus'));
        cid = cid == -1 ? nodes.findIndex(e => e.classList.contains('tvSelect')) : cid;
        cid = cid + ( opt == 'up' ? -1 : 1) + nodes.length;
        cid = cid % nodes.length;
        nodes[cid].click();
        setTimeout(function(){
            fetch('/sync-pid?pid='+window.location.search.split('=')[1])
        }, 1000);
        return;
    }
	
    if(moveTagert == 'tvs' && (opt == 'up' || opt == 'down')){
		let mm = document.querySelector('div.tv-main-con-r-list-left');
		let nodes = [...mm.childNodes];
		let cid = nodes.findIndex(v=>v.classList.contains('tvSelect'));
		nodes[cid].classList.remove('tvSelect');
        cid = cid + ( opt == 'up' ? -1 : 1) + nodes.length;
        cid = cid % nodes.length;
		nodes[cid].classList.add('tvSelect');
        let sc = cid * (nodes[0].offsetHeight) - 100;
		mm.scrollTop = sc > 0 ? sc : 0;
	}

    if(opt == 'center'){ // 
		if(moveTagert == 'tvs'){
			document.querySelector('div.tv-main-con-r-list-left>div.tvSelect').click();
			viewTVs()
			return;
		}
        if(Date.now() - lastCenterPressTime > 1000){
            lastCenterPressTime = Date.now()
        }else{
            window.location.reload()
        }
        return;
    }
    if(opt == 'back'){
		if(moveTagert == 'tvs'){
			viewTVs()
		}
    }
    if(opt == 'menu'){
		viewTVs()
    }
}

function viewTVs(){
	let ww = 70;
    let vv = document.querySelector('div[id*=vodbox]');
	if(vv.style.width.indexOf(ww+'%') > -1 ){
		vv.style.setProperty('width', '', '');
		moveTagert = 'pid';
        vv.style.setProperty('width', window.screen.availWidth + 'px', 'important');
        vv.style.setProperty('height', window.screen.availHeight + 'px', 'important');
		return;
	}else{
		vv.style.setProperty('width', ww+'%', 'important');
		moveTagert = 'tvs';
	}
	
	let mm = document.querySelector('div.tv-main-con-r-list-left')
	mm.style.setProperty('position', 'fixed', 'important');
	mm.style.setProperty('top', '0', 'important');
	mm.style.setProperty('right', '0', 'important');
	mm.style.setProperty('height', '100%', 'important');
	mm.style.setProperty('width', (100-ww)+'%', 'important');
	mm.style.setProperty('background-color', 'black', 'important');
	mm.style.setProperty('z-index', '9999', 'important');
	mm.style.setProperty('overflow', 'scroll', 'important');

	let nodes = [...mm.childNodes]
	let cid = nodes.findIndex(e => e.classList.contains('tvFocus'));
	if(cid == -1){
		cid = nodes.findIndex(e => e.classList.contains('tvSelect'));
		nodes[cid].classList.add('tvFocus');
	}
	
	setTimeout(function(){
		let cid = (nodes.findIndex(e => e.classList.contains('tvSelect')));
        let sc = cid * (nodes[0].offsetHeight) - 100;
		mm.scrollTop = sc > 0 ? sc : 0;
	}, 100)
	mm.querySelectorAll('div').forEach(el=> {
		el.style.display = '';
        if(el.childNodes[0]){
            el.childNodes[0].style && (el.childNodes[0].style.color = 'white');
            el.childNodes[0].style && (el.childNodes[0].style.fontSize = '24px');
            el.childNodes[0].style && (el.childNodes[0].style.overflow = 'hidden');
        }
	})
}
